(4,	21,	'Test-004',	'Bad/Log/PROC/1.0',	1,	1,	1,	1,	2,	'KAVITA PALANDE',	NULL,	1.0,	'2021-04-16',	NULL,	'{\"objective\":\"Process for Exporting of Non Hazardous Cargo\",\"department_and_third_party_involvement\":[\"Logistics\",\"Sales\",\"CHA\"],\"list_of_document_involved\":[\"Exp.Inv\\/ExpPL\\/COA\\/MSDS\\/ COO\",\"Draft BL\",\"Dispatch Approval Form\",\"Dispatch Approval Form\",\"COO\",null],\"process_description\":{\"description\":[\"Stores moves the FG by batch number into the dispatch section and hands over  Physical copy of Delivery Note from Tally to Logistics for dispatch.\",\"Quotation Rate Approval from CHA (Enquiry to be floated with at-least 3 CHA offices)\",\"Vessel Schedule received from the CHA office\",\"Packaging prior to Dispatch - Palletization, Pallet Labels, Strapping & Shrink Wrap (Vessel Cut-Off Date is Critical and needs to be monitored closely)\",\"Request Accounts for Tax Invoice Print (Triplicate)\",\"Complete Export Documentation Printing (4 Sets)  13.1.1 - 13.1.8(Inv\\/PL\\/VGM\\/EVD\\/Non-Haz Cert) \\/ 12.1.1 - 12.1.4 (COA) \\/ 4.1.1 - 4.1.7 (EWAY Bill)\",\"Arranging Forklift & Transport for movement of Cargo to Nhava Sheva\",\"If Cargo is going by Sea, CHA \\/ Nomination agent will notify the CFS Gate Name where the Cargo will be held for stuffing and in case of Air, it goes to Airport Cargo section. Dispatch accordingly.\",\"Get Dispatch Approval Form duly signed from A\\/c & Logistics HOD before dispatching the material\",\"Soft copy of Export documents to be Emailed to the CHA \\/ Nominated Agent\'s office for Clearance of Cargo\",\"CHA will then email the Check-list for our approval, before filing Shipping Bill (SB gets filed basis Check-list approved)\",\"Email duly signed Check-list approval form to CHA office.\",\"COO generation (IAFTA & SEPA through agent) 3.1\\/3.2\\/3.3\",\"BL Draft approval from Sales\",\"Couriering of Documents to Consignee with COO & Email Softcopy to Sales\",\"Receiving Documents from CHA Office & notifying Accounts for Bank submission of the documents\",\"Physical Storage of Export Documents\",\"CHA Bill Verification & Submission to Accounts\",null],\"unit\":[\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",null],\"designation_responsibility\":[\"Store Manager\",\"Manager -Logistics Export\",\"CHA-Office\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"Manager -Logistics Export \\/ Accounts Head\",\"Manager -Logistics Export\",\"CHA office\\/Logistics Export & Accounts\",\"Manager -Logistics Export \\/ Accounts Head\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"CHA office\\/Manager - Logistics Export & Accounts HOD\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",null],\"document_in_use\":[\"Delivery Note\",\"Email \\/ Export P.O.\",\"Email\",\"Pallet Labels & Pallet Packing List (for pallet wise stacking accuracy)\",\"Tax Invoice\",\"Exp. Inv\\/ Exp PL\\/ VGM\\/Non Haz Cert.\\/EVD \\/ COA\\/ MSDS\\/ Insurance\\/Eway Bill\\/Tax Inv\",\"Job Challan for rate Approval\",\"Sealed envelope with 4 sets of documents & contact number at Carting Gate\",\"Dispatch Approval Form\",\"All Export documents - Email\",\"Check-list\",\"Check-list Approval Form\",\"COO\",\"Draft BL\",\"Exp.Inv\\/ExpPL\\/COA\\/MSDS\\/ COO\",\"Exp.Inv\\/Exp. PL\\/EVD\\/VGM\\/Shipping Bill\\/BL\\/CHA Inv\\/Measurement Bill\",\"-\",\"-\",null],\"spacial_remarks\":[\"Delivery Note - Batch number errors may occur.\",\"A comparison sheet (Quote Comparison.Xls) is used to get Final PO approved and Signed copy is emailed to the CHA office and original maintained\",\"Vessel schedule un-officially shared with Stores\\/Prod\\/QC for in time readiness of Cargo for dispatch\",\"Ensure that Production & QC labels are in place, Pallet Stacking to match QC labels for Drum numbers as per pallet packing list, Ensure packaging is clean & not damaged, Weigh EACH UNIT before palletization.\",\"Tax invoice does not go to the consignee but is used only for Customs Clearance\",\"Make sure Cargo is insured & Eway Bill generated before dispatch. Non Haz Certificate will be issued for Non-Hazardous Shipment\",\"Use approved vendors or if the vendor is new, make sure the rate matches or is less than the rate of approved vendors\",\"Information about the carting gate to be received from CHA office (in case of FOB shipment from the nominated agents office), Ensure an enclosed vehicle during Monsoon. Share the vehicle number & driver name & No. with concerned person at the receiving end.\",\"-\",\"This is to ensure smooth clearance process and cargo inwards at the CIF gate once the cargo reaches CIF\",\"Ensure that Check-list is reviewed and formally approved by Accounts Department & Only then confirm to the CHA office: Co. Info \\/ Consignee Info\\/Bank Details\\/AD Code\\/Drawback Banking details\\/Product\\/HS Code\\/Value\\/Terms\",\"-\",\"Maharashtra Chambers \\/ GSP Office - SPEA form & IAFTA form, Blank forms of SEPA\\/IAFTA\\/Maharashtra Chambers Forms\",\"Draft BL to be shared & approved by Sales Head to ensure zero error in the making of BL\",\"Ensure that the Courier reaches consignee BEFORE vessel reaches the port, CROSS check \\\"Payment Terms\\\" & Only courier once Payment terms have been MET OR Specific written approval from Sales is received.\",\"Accounts Department then needs to lodge the documents with the Bank\",\"Export Documentation \\/ Year \\/ File Number (Insurance Copy & Approved CHA Quotation)\",\"CHA Bill gets verified with the approved Quotation any discrepancies are either justified and accepted by HOD OR a debit note is issued by Accounts Dept. If there are any un-planned expenses, take pre-approval by email from HOD with A\\/c head in CC.\",null]}}',	'CREATE',	'ACTIVE',	'APPROVE',	'APPROVE',	NULL,	NULL,	NULL,	'2021-04-16 03:20:23',	'2021-04-16 03:34:10'),
(5,	21,	'Test-Log-005',	NULL,	1,	1,	1,	1,	1,	'KAVITA PALANDE',	NULL,	NULL,	'2021-04-16',	NULL,	'{\"objective\":\"Process for Shipping Hazardous Cargo 1.5 Packaging Group II - Update 1.1\",\"department_and_third_party_involvement\":[\"Sales\",\"Customer\",null,\"Stores\",\"Logistics\",\"CHA\"],\"list_of_document_involved\":[\"Delivery Note\",\"Tax Invoice\",\"Packing List\",null,null,null],\"process_description\":{\"description\":[\"Stores moves the FG by batch number into the dispatch section and hand over Physical copy of Delivery Note from Tally to Logistics for dispatch.\",\"Quotation Rate Approval from CHA (Enquiry to be floated with at-least 3 CHA offices)\",\"Request send to CHA for HAZ Cargo Approval (CHA sends Shipping Line format for HAZ Cargo declaration, which is signed, stamped and returned to CHA office).\",\"Vessel Schedule received from the CHA office\",\"Packaging prior to Dispatch - Palletization, Pallet Labels, Strapping & Shrink Wrap (Vessel Cut-Off Date is Critical and needs to be monitored closely)\",\"Request Accounts for Tax Invoice Print (Triplicate)\",\"Complete Export Documentation Printing (4 Sets) Ref: Process 13.1.1 - 13.1.8(Inv\\/PL\\/EVD\\/VGM) \\/ 12.1.1 - 12.1.4 (COA) \\/ 4.1.1 - 4.1.7(Eway Bill)\",\"Arranging Forklift & Transport for movement of Cargo to Nhava Sheva\",\"If Cargo is going by Sea, CHA \\/ Nomination agent will notify the CFS Gate Name where the Cargo will be held for stuffing and in case of Air, it goes to Airport Cargo section. Dispatch accordingly.\",\"Get Dispatch Approval Form duly signed from A\\/c & Logistics HOD before dispatching the material\",\"Soft copy of Export documents to be Emailed to the CHA \\/ Nominated Agent\'s office for Clearance of Cargo\",\"CHA will then email the Check-list for our approval, before filing Shipping Bill (SB gets filed basis Check-list approved)\",\"Email duly signed Check-list approval form to CHA office.\",\"COO generation (IAFTA & SEPA through agent) Ref: 3.1\\/3.2\\/3.3\",\"BL ( Bill of Landing) Draft approval from Sales\",\"Couriering of Documents to Consignee with COO & Email Softcopy to Sales Manager \\/ HOD\",\"Receiving Documents from CHA Office & notifying Accounts for Bank submission of the documents\",\"Physical Storage of Export Documents\",\"CHA Bill Verification & Submission to Accounts\"],\"unit\":[\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\",\"N\\/A\"],\"designation_responsibility\":[\"Store Manager\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"CHA-Office\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"Manager -Logistics Export \\/ Logistic Head \\/ Accounts Head\",\"Manager -Logistics Export\",\"CHA office\\/Logistics Export & Head - Accounts\",\"Logistics Export & Head - Accounts\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"CHA office\\/Logistics Export & Accounts\",\"Manager -Logistics Export\",\"Manager -Logistics Export\"],\"document_in_use\":[\"Delivery Note\",\"Email \\/ Export P.O.\",\"Exp.Inv\\/Exp.PL\\/MSDS\\/IIP Cert. \\/ Shipping Line HAZ Declaration Form\",\"Email\",\"Pallet Labels & Pallet Packing List (for palletwise stacking accuracy)\",\"Tax Invoice\",\"Exp. Inv\\/ Exp. PL\\/ VGM\\/ EVD\\/ COA\\/MSDS\\/Insurance\\/Eway Bill\\/Tax Inv\",\"Job Challan for rate Approval\",\"Sealed envelope with 4 sets of documents & contact number at Carting Gate\",\"Dispatch Approval Form\",\"All Export documents, including valid IIP certificate\",\"Check-list\",\"Check-list Approval Form\",\"COO\",\"Draft BL ( Billing Of Landing)\",\"Exp.Inv\\/Exp PL\\/COA\\/MSDS\\/ COO\",\"Exp.Inv\\/Exp. PL\\/EVD\\/VGM\\/Shipping Bill\\/BL\\/CHA Inv\\/Measurement Bill\",\"-\",\"CHA Invoice\"],\"spacial_remarks\":[\"Delivery Note - Batch number errors may occur. A red flag needs to be raised if Batch numbers appears wrong or illogical.\",\"A comparison sheet (Quote Comparison.xls) is used to get Final PO approved and Signed copy is emailed to the CHA office and original maintained in record.\",\"Ensure IIP Certificate is Valid, Use ONLY approved copies of MSDS, Inv & PL to be printed using Automated Sheet* Ref: Process 13.1.2\",\"Vessel schedule un-officially shared with Stores\\/Prod\\/QC for in time readiness of Cargo for dispatch\",\"Ensure that Production & QC labels are in place, Pallet Stacking to match QC labels for Drum numbers as per pallet packing list. Ensure packaging is clean & not damaged. Weigh EACH UNIT before palletization.\",\"Tax invoice does not go to the consignee but is used only for Customs Clearance\",\"Make sure Cargo is insured & Eway Bill generated before dispatch. Also note Non-Haz Certificate cannot go with HAZ Cargo so don\\u2019t print it.\",\"Use approved vendors or if the vendor is new, make sure the rate matches or is less than the rate of approved vendors.\",\"Information about the carting gate to be received from CHA office (in case of FOB shipment from the nominated agents office), Ensure an enclosed vehicle during Monsoon\",\"-\",\"This is to ensure smooth clearance process and cargo inwards at the CIF gate once the cargo reaches CIF\",\"Ensure that Check-list is reviewed and formally approved by Accounts Department & Only then confirm to the CHA office\",\"-\",\"Maharashtra Chambers \\/ GSP Office - SEPA form & IAFTA form, Blank forms of SEPA\\/IAFTA\\/MCC Forms\",\"Draft BL to be shared & approved by Sales Head to ensure zero error in the making of BL. Amending BL is costly.\",\"Ensure that the Courier reaches consignee BEFORE vessel reaches the port, CROSS check \\\"Payment Terms\\\" & Only courier once Payment terms have been MET OR Specific written approval from Sales is received.\",\"Accounts Department then needs to lodge the documents with the Bank\",\"Export Documentation \\/ Year \\/ File Number (Insurance Copy & Approved CHA Quotation)\",\"CHA Bill gets verified with the approved Quotation any discrepancies are either justified and accepted by HOD OR a debit note is issued by Accounts Dept. If there are any un-planned expenses, take pre-approval by email from HOD with A\\/c head in CC.\"]}}',	'DEACTIVATE',	'DEACTIVE',	NULL,	NULL,	NULL,	NULL,	NULL,	'2021-04-16 03:35:05',	'2021-04-16 03:35:05'),
