(19,	16,	'Test-QC-001',	'Bad/QC/PROC/1.0',	1,	2,	1,	23,	50,	'Kulkarni',	NULL,	1.0,	'2021-04-17',	NULL,	'{\"objective\":\"To elaborate step-by-step process involved in Inward on All liquid \\/solid  imported \\/local Raw material with SYSTEM GERERATED  PO\",\"department_and_third_party_involvement\":[\"Purchase\",\"Stores\",\"QC\"],\"list_of_document_involved\":[\"GRN & COA from Supplier\",\"Sample register & register\",\"Internal Testing Record Book\",\"Tally & Excel sheet (Testing Data)\",null,null],\"process_description\":{\"description\":[\"Information of receipt of Raw Material from stores\",\"write internal batch number at least 2 sides of jumbo \\/ packing  do entry in sample register  weigh the raw material & do entry in register\",\"withdraw samples\",\"Carry out testing as per raw material specification  parameters\",\"Check whether  Raw Material is as per specification  or not\",\"Enter all testing data in system\",\"Generate COA\",\"Get authorization from Technical Head\",\"Give Instruction To Stores APPROVAL \\/ REJECTION\",\"Generate QC labels & Affix on each bag\\/drum also write approved for which party  & approved for which process\'s on each pack  & coa number in circle\",\"get weighing slip from stores\",\"After approval  do raw material stock transfer  entry in system  & move the material to destination store with actual received quantity .\",null],\"unit\":[\"NOs\",\"NOs\",\"NOs\",\"NOs\",\"NOs\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\"],\"designation_responsibility\":[\"STORES Manager\",\"QC Head\",\"QC + STORES Heads\",\"QC Head\",\"QC Head\",\"QC Head\",\"QC Head\",\"Technical Head\",\"QC Head\",\"QC Head\",\"STORES\",\"QC \\/ STORES\",null],\"document_in_use\":[\"GRN & COA from Supplier\",\"REGISTER\",null,\"Internal Testing Record Book\",null,\"tally & excel sheet\",\"tally\",\"Tally\",null,null,null,\"Tally\",null],\"spacial_remarks\":[\"GRN should be generated for  Incoming Raw Material Batch Generation\",\"while unloading ensure batch numbers to be written on raw material bag\",\"use safety equipment\'s to avoided accidents , label container properly , follow sampling procedure from QC Manual\",\"Refer QC manual\",\"Refer QC manual  also compare with results of preshipment samples\",\"Inform Directly to Stores HEAD\",null,null,null,\"Ensure store Labels are affixed on each bag\\/ drum  , check batch number\",\"for final weight receipt of Raw Material\",null,null]},\"name_of_reference_document\":[\"Non\",null,null],\"reference_document_urls\":[\"reference_documents\\/Test-QC-001\\/19\\/161864850287.docx\"]}',	'CREATE',	'SAVED',	NULL,	NULL,	NULL,	NULL,	NULL,	'2021-04-17 02:57:36',	'2021-04-17 03:05:02'),
(20,	25,	'Test-HRADM-001',	'Bad/HR&/PROC/1.0',	1,	5,	1,	64,	106,	'Sumant K',	'Mr. Maxeem Gill',	1.0,	'2021-04-17',	NULL,	'{\"objective\":\"To elaborate step-by-step process involved in Hiring HOD\'s & Managers\",\"department_and_third_party_involvement\":[\"MD Sir\\u2019s Office\",\"HR head\",\"Accounts\",\"Candidate\",\"Recruitment Agency\",null,null,null,null],\"list_of_document_involved\":[\"JD (Job Description & Job specification) of Candidate\",\"Candidate\\u2019s Application\",\"Standard Offer Letter Format\",\"Soft Copy of Letter of Resignation duly accepted.\",\"Welcome Letter - Standard Format\",\"Individual Employee File (With Name)\",\"Bill From Recruitment Agency\",\"mmmmmmmmmmmmmmmmm mmmmmmmmmmmmmmmm mmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmm\",\"mmmmmmmmmmmmmmmmmmmmmm mmmmmmmmmmmmmm mmmmmmmmmmmmmmmm\"],\"process_description\":{\"description\":[\"Receive instruction from MD Sir\'s office for HOD position recruitment\",\"Write up and finalise JD with MD Sir\'s office for the concerned vacancy\",\"List out recruitment options, their costs and submit to MD Sir\'s office for approval and finalisation of agency for placement search.\",\"Shortlist at-least 5 candidates per position and file them for MD\'s review\",\"Schedule the interviews as per directions received from MD\'s office.\",\"Conduct Interviews as scheduled, in case of any changes or delays, inform MD\'s secretary well in time & re-schedule as confirmed by the secretary.\",\"Candidate Selection\",\"Offer Letter\\/s to be issued to the Selected Candidates, requesting information, documentation & Dt. Of joining\",\"Check References and Perform Background Checks.\",\"Receive a copy of \\\"Resignation Letter duly accepted\\\".\",\"Joining Confirmation\",\"Welcome \\/ Induction of Employee on Joining Day\",\"Documentation\",\"Handing Over Access Card\",\"Bill Submission\",\"Payments\",null],\"unit\":[\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\"],\"designation_responsibility\":[\"MD Sir\",\"HR Head\",\"HR Head\",\"HR Head\",\"HR Head\",\"HR Head & Secretary\",\"MD Sir\",\"HR Head\",\"HR Head\",\"HR Head & Candidate\",\"HR Head\",\"HR Head\",\"HR Head\",\"HR Head\",\"HR Head\",\"Accounts\",null],\"document_in_use\":[\"Email \\/ Verbal instructions\",null,\"Jobsearchindia.in                 Shailendra                                               02241134431. \\/  9619680322 career.weaspire.com                 Sanjana 9139154804 \\/ 8805399440\",\"File Name format - \\\"Designation\\\" for Example \\\"Marketing Manager\\\"\",\"\\\"Interview Schedule\\\"\",\"Interview Schedule\",\"Verbal instructions \\/ Email\",\"Standard Offer Letter Format\",null,\"Soft Copy of Letter of Resignation duly accepted.\",null,\"Welcome Letter - Standard Format\",\"Individual Employee File (With Name)\",null,\"Bill\",null,null],\"spacial_remarks\":[null,\"Job Description & Job specification describes the knowledge, skills, education, experience, and abilities you believe are essential to performing a particular job.\",\"Mail your Candidates requirement with all the necessary inputs to Job consultants or any sources from which company can Hire desired candidate\",\"The goal is to eliminate the applicants who definitely don\'t fit the profile you are seeking. File at-least 5 CVs in the file and hand-over to MD\'s Secretary for MD\'s review.\",\"MD\'s secretary will follow up with MD for interview schedules.\",\"If any last minute cancellations happen from MD\'s office, intimate the candidates \\/ agency about the same and re-schedule the interviews.\",\"MD\'s secretary shall notify shortlisted candidate \\/ candidates for further negotiations & \\/ or term finalisation as per interview discussion, arrange for second round of interview if required.\",\"-\",\"check references and background for the candidates during and following your second interviews. Make sure you check all claims by the candidate including educational credentials, employment history and criminal background. When possible, the best source of information is the applicant\\u2019s past managers \\/ HR Head Dept\",null,\"Confirm the Date of Joining after all the necessary discussions with the Candidates\",\"Critical - Email ID generation, PC, Sitting Space, Swipe Card, Office SIM card, T-shirts, Office Timings & general information.\",\"Resume, Qualifications Certificates, Past Employment Reliving Letter, Aadhar Card, PAN Card, Signing of NDA, Duly signed duplicate copy of Offer letter and Appointment letter, 2 passport size photos. Make a file and keep in records. Handing over Access Card and walkie talkie(HOD)\",\"For Attendance & Door Access\",\"If candidate hired from Job consultancy submit the bill to Account dept according to the terms and conditions decided with them. Please confirm with the accounts for the terms or go tHR Headough the mail. (HR Head@rcmpa.com) job consultants 1. career.weaspire 6% + GST of Yearly Package 2. jobsearchindia.in 7% + GST of yearly package\",\"Confirm with the accounts that payment is done in time\",null]},\"name_of_reference_document\":[\"JD (Job Description & Job specification)Fomat  of Candidate\",\"Candidate\\u2019s Application format\",\"Standard Offer Letter Format\",\"Welcome Letter - Standard Format\",null,null],\"reference_document_urls\":[]}',	'CREATE',	'ARCHIVED',	'APPROVE',	'APPROVE',	NULL,	NULL,	NULL,	'2021-04-17 03:14:48',	'2021-04-17 06:09:41'),
