(24,	26,	'Test-Fin-003',	'Bad/Fin/PROC/1.0',	1,	6,	1,	73,	146,	'Amit Singh',	'Mr. Maxeem Gill',	1.0,	'2021-04-17',	NULL,	'{\"objective\":\"To elaborate step-by-step process involved in Bill Booking i.e Sales Bill Booking.\",\"department_and_third_party_involvement\":[\"Accounts\",\"Stores\",\"Logistics\",\"QC\",null,null],\"list_of_document_involved\":[\"Delivery Note\",\"Tax Invoice\",null],\"process_description\":{\"description\":[\"Accounts make Delivery Note from Tally with the Help of QC Head against Sales Order.\",\"Delivery Note is handed over to Stores, who Moves material from Main Stores to Dispatch Area & then handover the Delivery Note to Logistics Team.\",\"Logistics Team makes the material ready by Following Customers Packaging & Labelling Instructions.\",\"After Labelling by Logistics, QC Dept, affix the final label of \\\" QC Approved\\\".\",\"After Receiving Instructions & Delivery Note from Logistics Team, Accounts Team make the Sales Bill from Tally.\",\"Once Sales Bill is made by Accounts Asst.,Accounts Head Approves the Sales Bill.\",\"After Approval, Accounts Head gives 3 printout of Sales Bill.\",\"After Printout, 3 Copies of Sales Invoice handed over to Logistics Team for Dispatch.\",\"Logistics Team , will make the Eway Bill ,if Required.\",null,null,null,null,null],\"unit\":[\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\"],\"designation_responsibility\":[\"Accounts Head\",\"Stores Asst. \\/ Manager\",\"Logistics Head\",\"QC Chemist\",\"A\\/C\'s Asst.\",\"Accounts Head\",\"Accounts Head\",\"Accounts Head\",\"Logistics Head\",null,null,null,null,null],\"document_in_use\":[null,\"Delivery Note\",\"Delivery Note\",null,null,\"Tax Invoice\",\"Tax Invoice\",\"Tax Invoice\",\"Tax Invoice\",null,null,null,null,null],\"spacial_remarks\":[\"Delivery Note : Required for Batch Number & Qty allotted to respective Sales Order.\",\"Stores team used the Delivery note for Movement of material of Specific Batch Allotted to customer.\",null,null,null,null,\"Sales Bill has 2 Signatures (Accounts Head & Sales Head)\",\"-\",\"Eway Bill is required if, Value of Sales Bill is above Rs 50,000 ( Interstate) & Rs 1,00,000.00 ( within State)\",null,null,null,null,null]},\"name_of_reference_document\":[\"Non\",\"-\",\"-\"],\"reference_document_urls\":[\"reference_documents\\/Test-Fin-003\\/24\\/161865197770.docx\"]}',	'CREATE',	'ACTIVE',	'APPROVE',	'APPROVE',	NULL,	NULL,	NULL,	'2021-04-17 03:52:32',	'2021-04-17 04:05:16'),
(25,	27,	'Test-Prdn-001',	'Bad/Pro/PROC/1.0',	1,	7,	1,	105,	225,	'Vinod Tarmale',	'Mr. Maxeem Gill',	1.0,	'2021-04-17',	NULL,	'{\"objective\":\"To elaborate step-by-step process involved in Exporting Haz shipments  \\u2022\\tAirlines will generally not accept HAZ Cargo \\u2022\\tIn case of Air Cargo - one envelope containing documents is send separately that goes along with the every shipment\",\"department_and_third_party_involvement\":[\"Stores\",\"COO Agent\",\"CHA\",\"Courier\",\"Forklift \\/ Pallet Wrapping\",\"A\\/C\",\"Transporter\",null,null],\"list_of_document_involved\":[\"Delivery Note\",\"Quotation Approval \\u2013 duly signed\",\"Export Documents \\u2013 Invoice \\/ PL \\/ COO \\/ COA \\/ EVD \\/ VGM \\/ E-Way Bill\",\"Export Invoice in INR from A\\/C\",\"Bill of Lading\",\"CHA Invoice & supportings\",null,null,null],\"process_description\":{\"description\":[\"Stores moves the FG by batch number into the dispatch section and hand over Physical copy of Delivery Note from Tally to Logistics for dispatch.\",\"Quotation Rate Approval from CHA (Enquiry to be floated with at-least 3 CHA offices)\",\"Request send to CHA for HAZ Cargo Approval (CHA sends Shipping Line format for HAZ Cargo declaration, which is signed, stamped and returned to CHA office).\",\"Vessel Schedule received from the CHA office\",\"Packaging prior to Dispatch - Palletization, Pallet Labels, Strapping & Shrink Wrap (Vessel Cut-Off Date is Critical and needs to be monitored closely)\",\"Request Accounts for Tax Invoice Print (Triplicate)\",\"Complete Export Documentation Printing (4 Sets) Ref: Process 13.1.1 - 13.1.8(Inv\\/PL\\/EVD\\/VGM) \\/ 12.1.1 - 12.1.4 (COA) \\/ 4.1.1 - 4.1.7(Eway Bill)\",\"Arranging Forklift & Transport for movement of Cargo to Nhava Sheva\",\"If Cargo is going by Sea, CHA \\/ Nomination agent will notify the CFS Gate Name where the Cargo will be held for stuffing and in case of Air, it goes to Airport Cargo section. Dispatch accordingly.\",\"Get Dispatch Approval Form duly signed from A\\/c & Logistics HOD before dispatching the material\",\"Soft copy of Export documents to be Emailed to the CHA \\/ Nominated Agent\'s office for Clearance of Cargo\",\"CHA will then email the Check-list for our approval, before filing Shipping Bill (SB gets filed basis Check-list approved)\",\"Email duly signed Check-list approval form to CHA office.\",\"COO generation (IAFTA & SEPA through agent) Ref: 3.1\\/3.2\\/3.3\",\"BL ( Bill of Landing) Draft approval from Sales\",\"Couriering of Documents to Consignee with COO & Email Softcopy to Sales Manager \\/ HOD\",\"Receiving Documents from CHA Office & notifying Accounts for Bank submission of the documents\",\"Physical Storage of Export Documents\",\"CHA Bill Verification & Submission to Accounts\",null],\"unit\":[\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\",\"KG\"],\"designation_responsibility\":[\"Store Manager\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"CHA-Office\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"Manager -Logistics Export \\/ Logistic Head \\/ Accounts Head\",\"Manager -Logistics Export\",\"CHA office\\/Logistics Export & Head - Accounts\",\"Logistics Export & Head - Accounts\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",\"CHA office\\/Logistics Export & Accounts\",\"Manager -Logistics Export\",\"Manager -Logistics Export\",null],\"document_in_use\":[\"Delivery Note\",\"Email \\/ Export P.O.\",\"Exp.Inv\\/Exp.PL\\/MSDS\\/IIP Cert. \\/ Shipping Line HAZ Declaration Form\",\"Email\",\"Pallet Labels & Pallet Packing List (for palletwise stacking accuracy)\",\"Tax Invoice\",\"Exp. Inv\\/ Exp. PL\\/ VGM\\/ EVD\\/ COA\\/MSDS\\/Insurance\\/Eway Bill\\/Tax Inv\",\"Job Challan for rate Approval\",\"Sealed envelope with 4 sets of documents & contact number at Carting Gate\",\"Dispatch Approval Form\",\"All Export documents, including valid IIP certificate\",\"Check-list\",\"Check-list Approval Form\",\"COO\",\"Draft BL ( Billing Of Landing)\",\"Exp.Inv\\/Exp PL\\/COA\\/MSDS\\/ COO\",\"Exp.Inv\\/Exp. PL\\/EVD\\/VGM\\/Shipping Bill\\/BL\\/CHA Inv\\/Measurement Bill\",null,\"CHA Invoice\",null],\"spacial_remarks\":[\"Delivery Note - Batch number errors may occur. A red flag needs to be raised if Batch numbers appears wrong or illogical.\",\"A comparison sheet (Quote Comparison.xls) is used to get Final PO approved and Signed copy is emailed to the CHA office and original maintained in record.\",\"Ensure IIP Certificate is Valid, Use ONLY approved copies of MSDS, Inv & PL to be printed using Automated Sheet* Ref: Process 13.1.2\",\"Vessel schedule un-officially shared with Stores\\/Prod\\/QC for in time readiness of Cargo for dispatch\",\"Ensure that Production & QC labels are in place, Pallet Stacking to match QC labels for Drum numbers as per pallet packing list. Ensure packaging is clean & not damaged. Weigh EACH UNIT before palletization.\",\"Tax invoice does not go to the consignee but is used only for Customs Clearance\",\"Make sure Cargo is insured & Eway Bill generated before dispatch. Also note Non-Haz Certificate cannot go with HAZ Cargo so don\\u2019t print it.\",\"Use approved vendors or if the vendor is new, make sure the rate matches or is less than the rate of approved vendors.\",\"Information about the carting gate to be received from CHA office (in case of FOB shipment from the nominated agents office), Ensure an enclosed vehicle during Monsoon\",null,\"This is to ensure smooth clearance process and cargo inwards at the CIF gate once the cargo reaches CIF\",\"Ensure that Check-list is reviewed and formally approved by Accounts Department & Only then confirm to the CHA office\",null,\"Maharashtra Chambers \\/ GSP Office - SEPA form & IAFTA form, Blank forms of SEPA\\/IAFTA\\/MCC Forms\",\"Draft BL to be shared & approved by Sales Head to ensure zero error in the making of BL. Amending BL is costly.\",\"Ensure that the Courier reaches consignee BEFORE vessel reaches the port, CROSS check \\\"Payment Terms\\\" & Only courier once Payment terms have been MET OR Specific written approval from Sales is received.\",\"Accounts Department then needs to lodge the documents with the Bank\",\"Export Documentation \\/ Year \\/ File Number (Insurance Copy & Approved CHA Quotation)\",\"CHA Bill gets verified with the approved Quotation any discrepancies are either justified and accepted by HOD OR a debit note is issued by Accounts Dept. If there are any un-planned expenses, take pre-approval by email from HOD with A\\/c head in CC.\",null]},\"name_of_reference_document\":[\"Export_DispatchForm.xlsx\",\"AUTOMATEDEXPINVOICE&PL - new 29.09.2020.xlsm\",null],\"reference_document_urls\":[]}',	'CREATE',	'ACTIVE',	'APPROVE',	'APPROVE',	NULL,	NULL,	NULL,	'2021-04-17 04:14:51',	'2021-04-17 04:50:53'),
(26,	27,	'Test-Prdn-001',	'Bad/Pro/SOP/1.0',	1,	7,	2,	98,	213,	'Vinod Tarmale',	NULL,	1.0,	'2021-04-17',	NULL,	'{\"objective\":\"SOP\'s  Involved in manufacturing of CAN  From Cerium IV Hydroxide.\",\"chemical_required\":{\"checmical_name\":[\"Nitric Acid\",\"TREO Basis Cerium Hydroxide\",\"T Solution of Total TREO\",\"Ammonium  Nitrate Crystals\",\"Cerium IV Nitrate  Concentrate   Clear Solution\",\"Free Nitric Acid\"],\"chemical_make\":null,\"chemical_grade_purity\":null,\"chemical_quantity\":null,\"chemical_unit\":[\"KG\",\"KG\",\"NOs\",\"KG\",\"KG\",\"KG\"]},\"equipement_required\":{\"equipement_name\":[\"PP Black Coloured reactor\",\"Scrubber\",\"Cut Drums\",\"Tray Dryer\",\"Blue Drums\"],\"equipement_location_mark_and_number\":[null,null,null,null,null],\"equipement_capacity\":[\"5KL\",null,\"7-8 (200 Lit)\",null,\"25\"],\"equipement_unit\":[\"KG\",\"KG\",\"KG\",\"KG\",\"KG\"]},\"pre_production_process\":\"<ol>\\r\\n\\t<li>Clean 5 Kl Pp Black Coloured&nbsp; Reactor. Take Approval&nbsp; From QC .<\\/li>\\r\\n<\\/ol>\",\"production_process\":\"<ol>\\r\\n\\t<li>Take 2600 Kg Nitric Acid in 5 Kl&nbsp; Pp Reactor,&nbsp; Start Scrubber &amp; Apply Suction to Reactor.&nbsp; Now Add 710Kg<\\/li>\\r\\n\\t<li>TREO Basis Cerium Hydroxide (&nbsp; Nitric Require Will Be 3.66 T of TREO. 1000kg&nbsp; Hydroxide of 71&nbsp; % TREO&nbsp; )<\\/li>\\r\\n\\t<li>with Stirring Continue Stirring for 3-4 Hrs, Then Transfer This Slurry to 20KL White PP Tank Near GLR ,&nbsp;&nbsp; Repeat this for Two Batches Or As Per Requirement.<\\/li>\\r\\n\\t<li>Allow to Settle for Two Days,&nbsp; After 2 Days Analyse TREO in Clear Solution. Mean While Take 7-8 Cut Drums of 200 Lit&nbsp; &amp; Take 75 Lit Nitric in Each Drum . Connect This to Ammonia Addition&nbsp; Unit &amp; Purge Liquid Ammonia Till&nbsp; It&nbsp; Becomes Neutral. The Reaction Is&nbsp; Exothermic So Addition&nbsp; Must Be in&nbsp; Controlled Way due to Heat Generation the Drum May Melt<\\/li>\\r\\n\\t<li>We&nbsp; Need 2.66 T Solution of Total TREO. Prepare Accordingly As Require for Individual&nbsp; Batch.&nbsp; If We Are dissolving Amonium&nbsp; Nitrate Crystals Then Take 1.33 Times Ammonium&nbsp; Nitrate Crystals and Dissolve It&nbsp; in 1.1 Water and Use in Batch.<\\/li>\\r\\n\\t<li>Now Take 1500&nbsp; lit\\/1000Iit&nbsp; Cerium IV Nitrate&nbsp; Concentrate&nbsp;&nbsp; Clear Solution in 3 KL \\/2kL Glr,&nbsp;&nbsp; Analyse TREO in Lab and Calculate Amount&nbsp; of Ammonium&nbsp; Nitrate Solution Required for Batch, Add 24-26kg Or 15&nbsp; Kg Free Nitric Acid(0.016T&nbsp; of Volume) to Solution&nbsp;&nbsp; Close the Manhole .Apply&nbsp; Vaccume Through Ejector by Keeping 20 % Vent Valve Open.<\\/li>\\r\\n\\t<li>Start Heating at Steam Pressure of 2.4Kg&nbsp; Start Condenser Cooling to Start Condensation at 50&nbsp; at 75 C Add Ammonium&nbsp; Nitrate ( 2.66 T of TREO) Take Care That the Ammonium&nbsp; Nitrate Doesnot Touch Walls of Reactor Directly Which Causes&nbsp; damage of Reactor.<\\/li>\\r\\n\\t<li>After Addition of Ammonium&nbsp; Nitrate Continue Heating Till Temperature 120&nbsp;&nbsp;&nbsp; C&nbsp; (&nbsp; Distill Volume&nbsp; Approx 550 lit and Spg 157 for 1000lit Ce Iv Nitrate Soln).Check&nbsp; Spg at 480-525 lit&nbsp; Also.<\\/li>\\r\\n\\t<li>After Reaching 120* C \\/spg 1.57&nbsp; Stop Heating Cool Gradually for 11hrs.Apply&nbsp; Force Cooling for Approx&nbsp; 1hr Till Temp 50*<\\/li>\\r\\n\\t<li>At 50 * C&nbsp; Unload Slurry on Nutch and Keep It on Nutch for 2Hr&nbsp; to Remove All ML. Transfer This ML to Waste CAN\\/ CAS ML Storage 8 KL Black PP Tank .(600 Iit&nbsp; NUtch ML)<\\/li>\\r\\n\\t<li>After 1&nbsp;&nbsp;&nbsp; Hr Start Loading CF 2 &amp; CF 3 Only ,&nbsp;&nbsp; These Two CF Are Coated and Can Be Used in CAN Medium, Ther CF Are Not Suitable for This Duty Cause Corresion So Do Not Use Other CFS .&nbsp;&nbsp; Do Not Use Ss Scoops Also.<\\/li>\\r\\n\\t<li>Spin the Cf for 1hr&nbsp; Load the Cf Material in SS Trays of SS Tray Dryer Load Around 8.0-8.5Kg&nbsp; Material in&nbsp; Each Tray. Transfer All Cfml to Wate CAN\\/CAS ML 8 KL Black Storage Tank<\\/li>\\r\\n\\t<li>Close the Door and Start Heating of Tray Dryer at 4Kg Pressure, Keep 10 % Vent Valve Open .&nbsp;&nbsp; Allow to Raise Temperature&nbsp; Upto 85 * C, Keep Material&nbsp; at 85-80 C for 4 Hr,&nbsp; Then Cool&nbsp; Gradualy for 1hr 30min .Remove the Tray and Crush the Material&nbsp; Manually and Again Start Heating and Maintain at 85-80&nbsp; for 3hr 30mins. After Complete Dryng Cool the Dryer Till&nbsp; 45C with Blower ON ,&nbsp;&nbsp;&nbsp; After Cooling Fill the CAN Material&nbsp; in Liners . This Material&nbsp; ls Very Hygroscopic&nbsp; So Always&nbsp; Keep in Airtight Packing.<\\/li>\\r\\n<\\/ol>\",\"post_production_process\":\"<ol>\\r\\n\\t<li>Sieve the Material Through&nbsp; Plastic Sieve to Remove Over Size Material, Pack Proper Material in 25 Kg Packing in Blue Hdpe Drums. Seperate the Over Size Lumps, Weigh It and Put It in ML\\/ WASTE&nbsp; MLR Tank.<\\/li>\\r\\n\\t<li>Give 1Kg&nbsp; Sample to QC , Put Production &amp; Product Lables on Each Drum, Put Loose Material in&nbsp; Blue Drum with Lable As LOOSE Material.&nbsp; Transfer This Material to QC UNDER TESTING AREA.<\\/li>\\r\\n\\t<li>Update the BMR &amp; Close the BMR.<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\",\"name_of_reference_document\":[\"Non\",\"-\",\"-\"],\"reference_document_urls\":[{}]}',	'CREATE',	'SAVED',	NULL,	NULL,	NULL,	NULL,	NULL,	'2021-04-17 04:14:51',	'2021-04-17 04:36:13'),
